  "Allegations" : "Without admitting or denying the findings, de la Torre consented to the sanction and to the entry of findings that he functioned as a principal without becoming registered as a General Securities Principal. The findings stated that de la Torre failed to reasonably perform his supervisory duties by failing to review any of the transactions effected through a firm branch office to detect potential insider trading and other violative or suspicious activity, including \"high risk\" trading patterns and transfers between related and affiliated accounts, and did not otherwise reasonably supervise that branch or the two FINRA-registered traders who operated out of that location. Although he reviewed bond transactions for best execution purposes only, he did not review transactions for any other supervisory purposes, and did not implement any exception reporting to detect or respond to any patterns of activity that raised potential issues. Rather, de la Torre approved transactions without taking reasonable steps to determine if they presented any indicia of any violations of securities laws or FINRA rules.",
